define(function(){return Backbone.Model.extend({defaults:{counter:0,numCifrasMax:5},initialize:function(){},aumentarContador:function(){this.set("counter",this.get("counter")+1)},disminuirContador:function(){this.get("counter")>0&&this.set("counter",this.get("counter")-1)},resetearContador:function(){this.set("counter",0)},getContForm:function(){for(var t=this.get("counter")+"",n=t.length,e=n;e<this.get("numCifrasMax");e++)t="0"+t;return t}})});